import { TextField, Typography } from '@mui/material'
import React from 'react'

const Basics = () => {
  return (
    <div>
        <h1>lalalalalal</h1>
        <Typography variant='h1' color="primary.main">lalalalala</Typography>
        <TextField label='name' variant='filled'/>
        
    </div>
  )
}

export default Basics
